import React from 'react';
import { AppBar, Box, Toolbar, InputBase, styled } from '@mui/material';
import { Menu as MenuIcon, Search, Tune } from '@mui/icons-material';
import { gmailLogo } from '../constants/constants';
const StyledAppBar = styled(AppBar)`
  background: #f5f5f5;
  box-shadow: none;
`;
const SearchWrapper = styled(Box)`
  background: #eaf1f8;
`;
const Header = () => {
  return (
    <StyledAppBar position="static">
      <Toolbar>
        <MenuIcon color="action" />
        <img
          src={gmailLogo}
          alt="gmail-logo"
          style={{ width: 110, marginLeft: '15px' }}
        />
        <Box>
          <Search color="action" />
          <InputBase />
          <Tune color="action" />
        </Box>
      </Toolbar>
    </StyledAppBar>
  );
};

export default Header;
